      <BrowserRouter>
          <Routes>
            <Route path="/" element={<Home />}/>
            <Route path="/view-user/:id" element={<Viewuser />}/>
            <Route path="/delete-user/:id" element={<Delete />}/>
            <Route path="/edit-user/:id" element={<Edit />}/>
          </Routes>
      </BrowserRouter>
    </UserDataProvider>
    </div>
  );
}

